  const [admin, setAdmin] = useState("");
  const [lisa, setLisa] = useState("");

  useEffect(() => {
    getUsers(authToken).then((res) => {
      setUsers(res.USERS);
      setAdmin(res.USERS[0]);
      setLisa(res.USERS[2]);
      console.log(admin);
    });
  }, [authToken]);

  return <>{users && admin && <p>Hello, {admin.username}</p>}</>;
